import React, { Component } from 'react'
import PropTypes from 'prop-types'
import Link from 'next/link'

export default class extends Component {
  static propTypes = {
    q: PropTypes.number
  }

  constructor (props) {
    super(props);
    this.state = {
        ...this.props,
        next: this.props.q + 1
    };
  }

  componentDidMount() {}

  failure() {
      return('Invalid input')
  }

  success() {
    return (
      <div class="text-center">
        <div class="row">
          <div class="col">
            <h3>{ this.state.q }</h3>
            <h2>Peningkatan gaji pejabat, birokrat, dan semua PNS secara signifikan merupakan solusi mewujudkan birokrasi bebas korupsi</h2>
            <p>Setujukan Anda dengan pernyataan tersebut?</p>
          </div>
        </div>
        <div class="row text-left">
          <div class="col">
            <div class="custom-control custom-radio box-radio">
              <input type="radio" id="customRadio1" name="customRadio" class="custom-control-input"/>
              <label class="custom-control-label" for="customRadio1">Setuju</label>
            </div>
          </div>
          <div class="col">
            <div class="custom-control custom-radio box-radio">
              <input type="radio" id="customRadio2" name="customRadio" class="custom-control-input"/>
              <label class="custom-control-label" for="customRadio2">Tidak Setuju</label>
            </div>
          </div>
        </div>
        <div class="row">
          <div class="col">
          </div>
          <div class="col">
          </div>
          <div class="col">
            <Link href='question' as={ "/question/" + this.state.next }>
              <button type="button" class="btn btn-danger btn-block"><b>BERIKUTNYA</b></button>
            </Link>
          </div>
        </div>
      </div>
    )
  }

  render() {
      if (isNaN(this.state.q)) {
          return (this.failure())
      }
      return(this.success())
  }
}
